    <React.StrictMode>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <td></td>
        <Cliff_start></Cliff_start>
        <Cliff></Cliff>
        <Cliff></Cliff>
        <Cliff></Cliff>
        <Cliff></Cliff>
        <Cliff_end></Cliff_end>
        <td></td>
        <td></td>
        <td></td>
    </React.StrictMode>
);
*/
/*Earth_low.render(
    <React.StrictMode>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
            <Earth></Earth>
    </React.StrictMode>
);*/
Land_lower_level.render(
    <React.StrictMode>
            <Hero ></Hero>
            <td></td>
            <td></td>
            <Tree_1></Tree_1>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
            <td></td>
            <Tree_2></Tree_2>
            <td></td>
            <td></td>
            <td></td>
            <Tree_1></Tree_1>
            <td></td>
    </React.StrictMode>
);

const randomIndex = Math.floor(Math.random() * 16);
let randomCount = Math.floor(Math.random() * 4) + 1;
let html = '';

Land_lower_level.render(
    ()=>{
        for (let i = 0; i < 16; i++) {
            if (i === randomIndex) {
                html += '<Hero></Hero>';
                for (let j = 0; j < randomCount; j++) {
                    html += '<td></td>';
                }
                html += '<Tree_1></Tree_1>';
                let randomTreeCount = Math.floor(Math.random() * 4) + 1; // Случайное количество <Tree_1> элементов
                for (let k = 0; k < randomTreeCount; k++) {
                    html += '<Tree_1></Tree_1>';
                }
                html += '<td></td>';
                html += '<Tree_2></Tree_2>';
            } else {
                html += '<td></td>';
            }
        }
    },
    document.getElementById('root')
);
Bird_lower_level.render(
    <React.StrictMode>
            {[...Array(16)].map((_,i) =>
                i === randomIndex ? <Bird /> : <td></td>
            )}
    </React.StrictMode>,
    document.getElementById('root')
);

console.log(html);
Grass_and_earth.render(
    <React.StrictMode>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
        <Grass></Grass>
    </React.StrictMode>
);
